(1, 'মমরেজ  গলগন্ডা পাবলিক উচ্চ বিদ্যালয় ', 'শিক্ষা জাতির মেরুদন্ড', '১৯৮৮ ইং', '১১৪১৪৮', '', 'Logo.png', '', '০১৭২৭৩৫০২২৪', 'info@momrejgphs.edu.bd', ' মমরেজ গলগন্ডা,ঘাটাইল, টাঙ্গাইল', 'http://www.momrejgphs.edu.bd', 'মমরেজ  গলগন্ডা পাবলিক উচ্চ বিদ্যালয় , http://www.tritiyo.com', '9:00AM to 5:00 PM', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m10!1m8!1m3!1d3629.5725033535746!2d89.9839227!3d24.5348707!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sen!2sbd!4v1437993374527\" allowfullscreen></iframe>', 'এখনো কোন তথ্য হালনাগাদ করা হয়নি...................', 'মোঃ আবু হানিফ খান', '০১৭২৭৩৫০২২৪', 'abuhanif123.gmail.com', 'Gallery.jpg', 'Gallery.jpg', '“জীবনের প্রতি মুখে পড়িবে তোমার শূভ্র হাসি<br>প্রতি দুঃখে পড়িবে তোমার অশ্রু জল<br>প্রতি কাজে রবে তব শুভ হস্ত দুটি<br>কবি গুরু রবী ঠাকুরের আর্দশ খচিত পংক্তি মালার প্রতি শ্রদ্বাবনত হয়ে এই অজ পাড়াগায় ছোট বয়সেই একটি বিদ্যালয় যা এলাকাবাসীর যত্নে আদরের দুলালীর মত আজ পরিচিতি পাচ্ছে আর্দশ বিদ্যালয়। ঐতিহ্যবাহী ঘাটাইল উপজেলার ৩ংমডেল জামুরিয়া ইউনিয়নের ৫ং ওয়ার্ডের মমরেজ গলগন্ডা গ্রামের শিক্ষানুরাগী সমাজহিতৈষী,তরুণ,যুবক ও প্রধান ব্যক্তিবর্গের ঐকান্তিক প্রচেষ্টায় তালুক ভাদুরীর দশ-আনা তালুকের৫ মালিক স্বর্গীয় কৃতান্ত কুমার মিত্রের সহধর্মীনি দানবীর স্বর্গীয় হিরণ বালা মিত্রের ১.২১ একর জমি এলাকার শিক্ষার বিকাশে ও বিদযালয় প্রতিষ্ঠার জন্য দান করেন। তাহার দানকৃত জমির উপর বিদ্যালয়টি প্রতিষ্ঠিত হয়। যা আজ উজ্জলতম নক্ষত্ররুপে সুদুর গগনে ঠাই করে নিয়েছে।<br><br>আমার প্রায় ২৪বৎসরের শিক্ষকতা পেশায় অত্র বিদ্যালইয়ে আমি ১৭-০৪-২০১৪ইং তারিখে প্রধান শিক্ষক হিসেবে যোগদান করি। বিদ্যালয়ের সুদক্ষ পরিচালনা পরিষদ এবংদক্ষ কর্মঠ শিক্ষক মন্ডলীর সহযোগীতায় বিদ্যালয়ের শিক্ষার মান বৃদ্ধির জন্য নিরলস কাজ করে যাচ্ছি। বিদ্যালয়ে শিক্ষার মান বৃদ্ধির জন্য ধারাবাহিক মূল্যায়ন, সৃজনশীল পদ্ধতি,অনুসরনের চেষ্টা করিছি।<br><br>পরিশেষে বিদ্যালয় প্রতিষ্টার সাথে জড়িত সকল কে ধন্যবাদ জানাচ্ছি।<br>মোঃ আবু হানিফ খান<br>প্রধান শিক্ষক<br>মমরেজ গলগন্ডা পাবলিক উচ্চ বিদ্যালয়<br>ঘাটাইল,টাংগাইল<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;<br><br>', 'blankavatar.jpg', 'lightbluetheme', NULL, NULL, NULL);
