INSERT INTO `webpages` (`PageId`, `PageTitle`, `PageRoute`, `SpecificRoutes`, `ParentId`, `PageOrder`, `Description`, `PublishDate`, `isSpecial`, `isInMenu`, `isActive`) VALUES
(4, 'প্রতিষ্ঠানের নিয়ম শৃঙ্খলা', 'rules', NULL, 1, 0, '<!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakConstrainedForcedTables/>\r\n   <w:DontVertAlignInTxbx/>\r\n   <w:Word11KerningPairs/>\r\n   <w:CachedColBalance/>\r\n  </w:Compatibility>\r\n  <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"/>\r\n   <m:brkBin m:val=\"before\"/>\r\n   <m:brkBinSub m:val=\"--\"/>\r\n   <m:smallFrac m:val=\"off\"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val=\"0\"/>\r\n   <m:rMargin m:val=\"0\"/>\r\n   <m:defJc m:val=\"centerGroup\"/>\r\n   <m:wrapIndent m:val=\"1440\"/>\r\n   <m:intLim m:val=\"subSup\"/>\r\n   <m:naryLim m:val=\"undOvr\"/>\r\n  </m:mathPr></w:WordDocument>\r\n</xml><![endif]-->\r\n\r\n<p><font size=\"4\"><strong><span style=\"font-size:16.0pt;font-family:NikoshBAN\">নির্ধারিত পোশাক\r\nসবার জন্য বাধ্যতামূলক।</span></strong><span style=\"font-size:16.0pt;font-family:\r\nNikoshBAN\"></span></font></p><font size=\"4\">\r\n\r\n</font><p><font size=\"4\"><span style=\"font-size:16.0pt;font-family:NikoshBAN\"><br>\r\n</span><span style=\"font-size:18.0pt;font-family:NikoshBAN;\r\ncolor:red;mso-bidi-language:BN-BD\" lang=\"BN-BD\">* </span><span style=\"font-size:16.0pt;\r\nfont-family:NikoshBAN\">মোবাইল, সিম কার্ড, ক্যামেরা, বাইনোকুলার ক্লাশে আনা যাবে\r\nনা।</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;\r\nmso-bidi-language:BN-BD\" lang=\"BN-BD\"></span></font></p><font size=\"4\">\r\n\r\n</font><p><font size=\"4\"><span style=\"font-size:16.0pt;font-family:NikoshBAN\"><br>\r\n</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;\r\ncolor:red;mso-bidi-language:BN-BD\" lang=\"BN-BD\">* </span><span style=\"font-size:16.0pt;\r\nfont-family:NikoshBAN\">নির্ধারিত তারিখে বেতন পরিশোধ করতে হবে। অন্যথায় বিধি\r\nঅনুযায়ী জরিমানা দিতে হবে।</span><span style=\"font-size:16.0pt;\r\nfont-family:NikoshBAN;mso-bidi-language:BN-BD\" lang=\"BN-BD\"></span></font></p><font size=\"4\">\r\n\r\n</font><p><font size=\"4\"><span style=\"font-size:16.0pt;font-family:NikoshBAN\"><br>\r\n</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;\r\ncolor:red;mso-bidi-language:BN-BD\" lang=\"BN-BD\">* </span><span style=\"font-size:16.0pt;\r\nfont-family:NikoshBAN\">প্রত্যেক মাসিক, সেমিস্টার প্রাক নির্বাচনী\r\nপরীক্ষা&nbsp;পর্যন্ত মাসিক বেতন, পরীক্ষার ফি সহ সমুদয় </span><span style=\"font-size:16.0pt;font-family:NikoshBAN;mso-bidi-language:BN-BD\" lang=\"BN-BD\"><span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size:16.0pt;\r\nfont-family:NikoshBAN\">বকেয়া পরিশোধ করে প্রবেশপত্র সংগ্রহ করতে হবে।</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;mso-bidi-language:\r\nBN-BD\" lang=\"BN-BD\"></span></font></p><font size=\"4\">\r\n\r\n</font><p><font size=\"4\"><span style=\"font-size:16.0pt;font-family:NikoshBAN\"><br>\r\n</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;\r\ncolor:red;mso-bidi-language:BN-BD\" lang=\"BN-BD\">* </span><span style=\"font-size:\r\n16.0pt;font-family:NikoshBAN;mso-bidi-language:BN-BD\" lang=\"BN-BD\">প্রধান</span><span style=\"font-size:16.0pt;font-family:NikoshBAN\">/ সহকারী প্রধান শিক্ষক\r\nএর&nbsp;পূর্বানুমতি ছাড়া কোন শিক্ষার্থী ক্লাসে অনুপস্থিত থাকতে পারবে না।\r\nঅসুস্থতা বা অনিবার্য কোনো কারণে অননুমোদিত অনুপস্থিতির জন্য পরবর্তী উপস্থিতির\r\nদিনেই অভিভাবক এবং ক্লাশ টিচারের সুপারিশসহ লিখিত দরখাস্ত </span><span style=\"font-size:18.0pt;font-family:NikoshBAN;mso-bidi-language:\r\nBN-BD\" lang=\"BN-BD\">প্রধান</span><span style=\"font-size:16.0pt;font-family:NikoshBAN\">/\r\nসহকারী প্রধান শিক্ষকের&nbsp;নিকট জমা দিতে হবে। অন্যথায় নির্ধারিত হারে জরিমানা\r\nদিতে হবে।</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;\r\nmso-bidi-language:BN-BD\" lang=\"BN-BD\"></span></font></p><font size=\"4\">\r\n\r\n</font><p><font size=\"4\"><span style=\"font-size:16.0pt;font-family:NikoshBAN\"><br>\r\n</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;\r\ncolor:red;mso-bidi-language:BN-BD\" lang=\"BN-BD\">* </span><span style=\"font-size:16.0pt;\r\nfont-family:NikoshBAN\">বর্ষ-সমাপনী পরীক্ষায় অংশগ্রহন না করলে বা অনুত্তীর্ণ হলে\r\nকোনো ক্রমেই পরবর্তী শ্রেণিতে প্রমোশন দেয়া হবে না।</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;mso-bidi-language:BN-BD\" lang=\"BN-BD\"></span></font></p><font size=\"4\">\r\n\r\n</font><p><font size=\"4\"><span style=\"font-size:16.0pt;font-family:NikoshBAN\"><br>\r\n</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;\r\ncolor:red;mso-bidi-language:BN-BD\" lang=\"BN-BD\">* </span><span style=\"font-size:16.0pt;\r\nfont-family:NikoshBAN\">পর-পর দুইটি মাসিক/সেমিস্টার পরীক্ষায় অকৃতকার্য হলে কিংবা\r\nকোন পরীক্ষায় নকল করলে প্রতিষ্ঠান থেকে সরাসরি বহিষ্কার করা হবে।</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;mso-bidi-language:\r\nBN-BD\" lang=\"BN-BD\"></span></font></p><font size=\"4\">\r\n\r\n</font><p><font size=\"4\"><span style=\"font-size:16.0pt;font-family:NikoshBAN\"><br>\r\n</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;\r\ncolor:red;mso-bidi-language:BN-BD\" lang=\"BN-BD\">* </span><span style=\"font-size:16.0pt;\r\nfont-family:NikoshBAN\">দশম শ্রেণিতে নির্বাচনী পরীক্ষায় পর পরই পরীক্ষার্থীদের\r\nকোচিং শুরু হবে। উক্ত কোচিং ক্লাসে উপস্থিত থাকা নির্বাচনী পরীক্ষায় উত্তীর্ণ সকণ\r\nশিক্ষার্থীর জন্য বাধ্যতামূলক।</span><span style=\"font-size:16.0pt;\r\nfont-family:NikoshBAN;mso-bidi-language:BN-BD\" lang=\"BN-BD\"></span></font></p><font size=\"4\">\r\n\r\n</font><p><font size=\"4\"><span style=\"font-size:16.0pt;font-family:NikoshBAN\"><br>\r\n</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;\r\ncolor:red;mso-bidi-language:BN-BD\" lang=\"BN-BD\">* </span><span style=\"font-size:\r\n16.0pt;font-family:NikoshBAN;mso-bidi-language:BN-BD\" lang=\"BN-BD\">প্রধান</span><span style=\"font-size:16.0pt;font-family:NikoshBAN\">/সহকারী\r\nপ্রধান&nbsp;শিক্ষক&nbsp;/ক্লাশ টিচারের অনুমতি ব্যতীত ছুটির পূর্বে কোনোক্রমেই\r\nক্যাম্পাস ত্যাগ করা যাবে না। শিক্ষার্থীদের সকল প্রকার প্রয়োজন/অভিযোগের কথা সর্ব\r\nপ্রথম সংশ্লিষ্ট টিচার/ ক্লাশ টিচারকে&nbsp;জানাতে হবে।</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;mso-bidi-language:BN-BD\" lang=\"BN-BD\"></span></font></p><font size=\"4\">\r\n\r\n</font><p><font size=\"4\"><span style=\"font-size:16.0pt;font-family:NikoshBAN\"><br>\r\n<strong><span style=\"font-family:NikoshBAN\">জরিমানা বিধি:</span></strong></span></font></p><font size=\"4\">\r\n\r\n</font><p><font size=\"4\"><strong><span style=\"font-size:16.0pt;font-family:NikoshBAN\">ক্লাসে\r\nঅনুপস্থিতঃ</span></strong><span style=\"font-size:16.0pt;font-family:NikoshBAN\"><br>\r\n</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;\r\ncolor:red;mso-bidi-language:BN-BD\" lang=\"BN-BD\">* </span><span style=\"font-size:16.0pt;\r\nfont-family:NikoshBAN\">প্রতিদিন ক্লাসে অনুপস্থিতির জন্য ২০/-</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;mso-bidi-language:\r\nBN-BD\" lang=\"BN-BD\"></span></font></p><font size=\"4\">\r\n\r\n</font><p><font size=\"4\"><span style=\"font-size:16.0pt;font-family:NikoshBAN\"><br>\r\n</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;\r\ncolor:red;mso-bidi-language:BN-BD\" lang=\"BN-BD\">* </span><span style=\"font-size:16.0pt;\r\nfont-family:NikoshBAN\">ক্লাশ থেকে পালানোর জন্য ৫০/</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;mso-bidi-language:BN-BD\" lang=\"BN-BD\"></span></font></p><font size=\"4\">\r\n\r\n</font><p><font size=\"4\"><span style=\"font-size:16.0pt;font-family:NikoshBAN\">-<br>\r\n</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;\r\ncolor:red;mso-bidi-language:BN-BD\" lang=\"BN-BD\">* </span><span style=\"font-size:16.0pt;\r\nfont-family:NikoshBAN\">মাসিক পরীক্ষায় অনুপস্থিতির জন্য প্রতি বিষয়ে ১০০/-</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;mso-bidi-language:\r\nBN-BD\" lang=\"BN-BD\"></span></font></p><font size=\"4\">\r\n\r\n</font><p><font size=\"4\"><span style=\"font-size:16.0pt;font-family:NikoshBAN\"><br>\r\n</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;\r\ncolor:red;mso-bidi-language:BN-BD\" lang=\"BN-BD\">*</span><span style=\"font-size:16.0pt;\r\nfont-family:NikoshBAN\">অনুত্তীর্ণ হলে প্রতি বিষয়ে জরিমানা ১০০/-</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;mso-bidi-language:\r\nBN-BD\" lang=\"BN-BD\"></span></font></p><font size=\"4\">\r\n\r\n</font><p><font size=\"4\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:16.0pt;\r\nfont-family:NikoshBAN\"><br>\r\n</span></b><span style=\"font-size:16.0pt;font-family:NikoshBAN;\r\ncolor:red;mso-bidi-language:BN-BD\" lang=\"BN-BD\">*</span><span style=\"font-size:16.0pt;\r\nfont-family:NikoshBAN\">সেমিস্টার পরীক্ষায় অনুপস্থিতির থাকলে প্রতি বিষয়ে ১০০/-</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;mso-bidi-language:\r\nBN-BD\" lang=\"BN-BD\"></span></font></p><font size=\"4\">\r\n\r\n</font><p><font size=\"4\"><span style=\"font-size:16.0pt;font-family:NikoshBAN\"><br>\r\n</span><span style=\"font-size:16.0pt;font-family:NikoshBAN;\r\ncolor:red;mso-bidi-language:BN-BD\" lang=\"BN-BD\">*</span><span style=\"font-size:16.0pt;\r\nfont-family:NikoshBAN\">অনুত্তীর্ণ হলে প্রতি বিষয়ে ১০০/-</span><span style=\"font-size:16.0