font:minor-latin;mso-bidi-font-family:Vrinda;mso-bidi-theme-font:\r\nminor-bidi;color:red\" lang=\"AR-SA\">তথ্য প্রযুক্তি ক্ষেত্রে অধিকতর দক্ষতা বৃদ্ধি এবং জাতীয় ও\r\nআন্তর্জাতিক</span><span style=\"color:red\" lang=\"AR-SA\"> </span><span style=\"font-family:Vrinda;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:Vrinda;mso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\">পর্যায়ে\r\nতথ্য প্রযুক্তি সংক্রান্ত ও কম্পিউটার প্রোগ্রামিং প্রতিযোগিতায়</span><span style=\"color:red\" lang=\"AR-SA\"> </span><span style=\"font-family:Vrinda;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Vrinda;\r\nmso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\">অংশগ্রহণের লক্ষ্যে গড়ে তোলা হয়\r\nকম্পিউটার ক্লাব। বিশেষ বাছাই প্রক্রিয়ার মাধ্যমে এই ক্লাবের সদস্য হিসেবে মনোনীত\r\nকরা হয়।</span><span style=\"color:red\" lang=\"AR-SA\"> </span><span style=\"font-family:Vrinda;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:Vrinda;mso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\">কম্পিউটার\r\nক্লাশের পাশাপাশি পূর্ব নির্ধারিত সময় অফ-পিরিয়ডের সময় এই</span><span style=\"color:red\" lang=\"AR-SA\"> </span><span style=\"font-family:Vrinda;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Vrinda;\r\nmso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\">ক্লাবের সদস্যরা সি-প্রোগ্রামিং</span><span style=\"color:red\">, </span><span style=\"font-family:Vrinda;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Vrinda;\r\nmso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\">কম্পিউটার হার্ডওয়ার ও ইন্টারনেটের\r\nউপর</span><span style=\"color:red\" lang=\"AR-SA\"> </span><span style=\"font-family:Vrinda;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:Vrinda;mso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\">কম্পিউটার\r\nল্যাব ব্যবহারের সুযোগ পেয়ে থাকে। কম্পিউটার বিভাগের শিক্প্রষক</span><span style=\"color:red\" lang=\"AR-SA\"> </span><span style=\"font-family:Vrinda;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Vrinda;\r\nmso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\">কম্পিউটার ক্লাবের মডারেটর হিসেবে\r\nদায়িত্ব পালন করেন।</span><span style=\"color:red\"></span></p>\r\n\r\n<p class=\"MsoNormal\"><strong><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:Vrinda;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\ncolor:red\" lang=\"AR-SA\">বিজ্ঞান ক্লাব</span></strong><strong><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:\r\nVrinda;mso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\"> </span></strong><span style=\"color:red\"></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:Vrinda;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-font-family:Vrinda;mso-bidi-theme-font:\r\nminor-bidi;color:red\" lang=\"AR-SA\">বিজ্ঞান শিক্ষাকে ছাত্র-ছাত্রীদের মাঝে অধিকতর আগ্রহ সৃষ্টি\r\nকরা</span><span style=\"color:red\">, </span><span style=\"font-family:\r\nVrinda;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;\r\nmso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:\r\nVrinda;mso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\">বিজ্ঞানভীতি দূর করা</span><span style=\"color:red\">, </span><span style=\"font-family:Vrinda;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Vrinda;\r\nmso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\">নিত্যনতুন বিজ্ঞানমূলক সৃজনশীলতা ও\r\nশিল্পকর্ম তৈরীতে</span><span style=\"color:red\" lang=\"AR-SA\"> </span><span style=\"font-family:Vrinda;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:Vrinda;mso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\">উৎসাহ\r\nপ্রদান এবং বিজ্ঞানভিত্তিক বিভিন্ন প্রতিযোগিতায় অংশগ্রহন করার</span><span style=\"color:red\" lang=\"AR-SA\"> </span><span style=\"font-family:Vrinda;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Vrinda;\r\nmso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\">লক্ষ্যে গঠন করা হয় বিজ্ঞান ক্লাব।\r\nআমাদের তরুণ ছেলে মেয়েরা বিজ্ঞান</span><span style=\"color:red\" lang=\"AR-SA\"> </span><span style=\"font-family:Vrinda;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:Vrinda;mso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\">বিষয়ক\r\nসৃজনশীল কাজে দেশে ও বিদেশে বিশেষভাবে অবদান রাখছে।</span><span style=\"color:\r\nred\"></span></p>\r\n\r\n<p class=\"MsoNormal\"><strong><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:Vrinda;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\ncolor:red\" lang=\"AR-SA\">কুইজ ক্লাব</span></strong><strong><span style=\"font-size:\r\n12.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Vrinda;\r\nmso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\"> </span></strong><span style=\"color:red\"></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:Vrinda;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-font-family:Vrinda;mso-bidi-theme-font:\r\nminor-bidi;color:red\" lang=\"AR-SA\">ছাত্রজীবন শেষে বিভিন্ন প্রতিযোগিতামূলক পরীক্ষায় সফলতা\r\nঅর্জন</span><span style=\"color:red\">, </span><span style=\"font-family:\r\nVrinda;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;\r\nmso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:\r\nVrinda;mso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\">কর্মজীবনে প্রয়োগ ও বাস্তবায়ন\r\nএবং পাঠ্যবইয়ের নির্ধারিত সিলেবাসের</span><span style=\"color:red\" lang=\"AR-SA\"> </span><span style=\"font-family:Vrinda;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:Vrinda;mso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\">পাশাপাশি\r\nসাধারণ জ্ঞানের পরিধি আরও সমৃদ্ধ করার লক্ষ্যে বিভিন্ন ক্লাশের</span><span style=\"color:red\" lang=\"AR-SA\"> </span><span style=\"font-family:Vrinda;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Vrinda;\r\nmso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\">ছাত্র-ছাত্রীদের নিয়ে গঠন করা হয়েছে\r\nকুইজ ক্লাব। এই ক্লাবের রয়েছে</span><span style=\"color:red\" lang=\"AR-SA\"> </span><span style=\"font-family:Vrinda;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:Vrinda;mso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\">বিভিন্ন\r\nউল্লেখযোগ্য অর্জন।</span><span style=\"color:red\" lang=\"AR-SA\"> </span><span style=\"color:red\"></span></p>\r\n\r\n<p class=\"MsoNormal\"><strong><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:Vrinda;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\ncolor:red\" lang=\"AR-SA\">খেলাধুলা</span></strong><strong><span style=\"font-size:\r\n12.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Vrinda;\r\nmso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\"> </span></strong><span style=\"color:red\"></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:Vrinda;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-font-family:Vrinda;mso-bidi-theme-font:\r\nminor-bidi;color:red\" lang=\"AR-SA\">ছাত্র-ছাত্রীরা শারীরিক শিক্ষার পাশাপাশি স্কুলে বিভিন্ন</span><span style=\"color:red\" lang=\"AR-SA\"> </span><span style=\"font-family:Vrinda;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Vrinda;\r\nmso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\">প্রতিযোগিতামূলক খেলাধূলায় স্বক্রিয় </span><span style=\"color:red\"></span></p>\r\n\r\n<p class=\"MsoNormal\"><strong><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:Vrinda;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\ncolor:red\" lang=\"AR-SA\">নৃত্য ও সংগীত দল</span></strong><strong><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:\r\nVrinda;mso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\"> </span></strong><span style=\"color:red\"></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:Vrinda;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-font-family:Vrinda;mso-bidi-theme-font:\r\nminor-bidi;color:red\" lang=\"AR-SA\">৬ষ্ঠ থেকে ৮ম শ্রেণী পর্যন্ত ছাত্র-ছাত্রীদের নিয়মিত\r\nপড়াশুনা ও</span><span style=\"color:red\" lang=\"AR-SA\"> </span><span style=\"font-family:Vrinda;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:Vrinda;mso-bidi-theme-font:minor-bidi;color:red\" lang=\"AR-SA\">ক্লাসের\r\nপাশাপাশি নৃত্য ও সঙ্গীত চর্চার সুযোগ রয়েছে। </span><span style=\"color:red\"></span></p>\r\n\r\n<!--[if gte mso 9]><xml>\r\n <w:LatentStyles DefLockedState=\"false\" DefUnhideWhenUsed=\"true\"\r\n  DefSemiHidden=\"true\" DefQFormat=\"false\" DefPriority=\"99\"\r\n  LatentStyleCount=\"267\">\r\n  <w:LsdException Locked=\"false\" Priority=\"0\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Normal\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"9\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"heading 1\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"9\" QFormat=\"true\" Name=\"heading 2\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"9\" QFormat=\"true\" Name=\"heading 3\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"9\" QFormat=\"true\" Name=\"heading 4\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"9\" QFormat=\"true\" Name=\"heading 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"9\" QFormat=\"true\" Name=\"heading 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"9\" QFormat=\"true\" Name=\"heading 