(59, 'প্রতিষ্ঠাতার ইতিহাস', 'founder-history', NULL, 1, 0, '<!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakConstrainedForcedTables/>\r\n   <w:DontVertAlignInTxbx/>\r\n   <w:Word11KerningPairs/>\r\n   <w:CachedColBalance/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"/>\r\n   <m:brkBin m:val=\"before\"/>\r\n   <m:brkBinSub m:val=\"--\"/>\r\n   <m:smallFrac m:val=\"off\"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val=\"0\"/>\r\n   <m:rMargin m:val=\"0\"/>\r\n   <m:defJc m:val=\"centerGroup\"/>\r\n   <m:wrapIndent m:val=\"1440\"/>\r\n   <m:intLim m:val=\"subSup\"/>\r\n   <m:naryLim m:val=\"undOvr\"/>\r\n  </m:mathPr></w:WordDocument>\r\n</xml><![endif]-->\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size:22.0pt;line-height:115%;\r\nfont-family:NikoshBAN;mso-bidi-language:BN-BD\" lang=\"BN-BD\"><span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"mso-spacerun:yes\">&nbsp;&nbsp;</span><span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><u><span style=\"color:#548DD4;mso-themecolor:text2;mso-themetint:153\"><span style=\"mso-spacerun:yes\">&nbsp;</span>বিদ্যালয়ের ইতিহাস</span></u></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size:14.0pt;mso-ansi-font-size:\r\n11.0pt;line-height:115%;font-family:NikoshBAN;mso-bidi-language:BN-BD\" lang=\"BN-BD\">টাঙ্গাইল\r\nজেলার ঘাটাইল উপজেলার দক্ষিণ-পশ্চিমে অবস্থিত ৩ নং জামুরিয়া মডেল ইউনিয়নের ৫ নং\r\nওয়ার্ডের অন্তগর্ত মমরেজ গলগন্ডা গ্রাম। শেখ মমরেজ নামক এক সাধক পুরুষের\r\nনামানুসারে এই গ্রামের নাম করন।<span style=\"mso-spacerun:yes\">&nbsp; </span>বহু\r\nচেষ্টা তদ্বিবের মাধ্যমে ১৯৭০ সালে কতিপয় সমাজ সংস্কারক গনের উদ্যোগে স্থাপিত হয়\r\nমমরেজ গলগন্ডা সরকারী প্রাথমিক বিদ্যালয়। ফলে অশিক্ষিত এই অজ পাড়া গায়ে আপাতত ;\r\nসকলের পক্ষে প্রাথমিক শিক্ষা পর্যন্ত লেখাপড়া করা অনেকটাই সহজ হয়ে উঠে। এরই\r\nধারাবাহিকতায় এই গ্রাম ও পাশ্ববর্তী গ্রাম সমুহের সমাজ সংস্কারক শিক্ষানুরাগী ও\r\nপ্রগতিশীল ব্যক্তি বর্গ এই এলাকায় মাধ্যমিক স্তর পর্যন্ত শিক্ষা অর্জনের চিন্তা\r\nভাবনা করে এখানে একটি মাধ্যমিক বিদ্যালয় স্থাপন করার সিদ্বান্ত গ্রহণ করেন। প্রগতিশীল\r\nব্যক্তি বর্গের মধ্যে যাদের নাম বিশেষ ভাবে ঊল্লেখযগ্য তারা হলেন এস.এস. মহিরউদ্দিন\r\nতাং, এস.এম.মজিবুর রহমান ,মোঃ দেলোয়ার হোসেন তাং,প্রকৌশলী আঃ রাজ্জাক মোঃ হাবিবুর\r\nরহমান (বীর বিক্রম),মুক্তিযোদ্বা ওমর আলী,(ব্যংক কর্মকর্তা,ঘাটাইল),মোঃ আব্বাস আলী\r\n, ,মোঃ ‘আমীর হামজা আরও অনেকে। উল্লেখিত <span style=\"mso-spacerun:yes\">&nbsp;</span>ব্যক্তি বর্গের চিন্তা ভাবনাকে কল্পনার জগত থেকে\r\nযিনি বাস্তবে রুপায়ন দেন তিনি হলেন তালুক ভাদুরীর দশ-আনা তালুকের মালিক কৃতান্ত কুমার\r\nমিত্রের সহধর্মীনি সমাজ হিতৈষি রমণী শ্রীমতি হিরণ বালা মিত্র। এই নিঃসন্তান\r\nশিক্ষানুরাগী ভদ্র মহিলা তার স্বত্বদখলীয় ১.২১ একর ভুমি বিদ্যালয়ের জন্য দান করেন।\r\nতার এই মহান প্রয়াস কে স্বাগত জানিয়ে এলাকাবাসী সিদ্বান্ত নেন যে প্রস্তাদবিত\r\nবিদ্যালয়ের নাম করন হবে</span><span style=\"font-size:14.0pt;\r\nmso-ansi-font-size:8.0pt;line-height:115%;font-family:NikoshBAN;mso-bidi-language:\r\nBN-BD\" lang=\"BN-BD\">”কৃতান্ত হিরণ বালা নিম্ন মাধ্যমিক বিদ্যালয়”</span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size:14.0pt;mso-ansi-font-size:\r\n8.0pt;line-height:115%;font-family:NikoshBAN;mso-bidi-language:BN-BD\" lang=\"BN-BD\">বিদ্যাদলয়টি\r\nপ্রতিষ্ঠিত হওয়ার কিছু দিন পর কৃতান্ত হিরণ বালা পরলোক গমন করেন । হিরণ বালা\r\nমিত্রের পরলোক গমনের পর সরকারী বিধি নিষেধ ও অর্থনৈতিক সমস্যার কারনে বিদ্যালয়ের\r\nস্বীকৃতি সংক্রান্ত কার্যক্রম স্থবির হয়ে পরে। ঠিক এই সমস্যার সকল কার্যক্রম কে\r\nগতিশীল করতে হাল ধরেন স্বর্গীয় হিরন বালা মিত্রের উত্তরশরী শ্রী গৌরাঈ কুমার মিত্র\r\nগং। তাদের অক্লান্ত পরিশ্রম ও নিরলস প্রচেষ্ঠায় ০১-০১-১৯৮৮ইং সালে প্রস্তাবিত\r\nবিদ্যালয়ের নামকরন পরিবর্তন হয়ে স্থাপিত” মমরেজ গলগন্ডা নিম্ন মাধ্যমিক বিদ্যালয়।\r\nকালের পরিক্রমায় নানাবিধ চরাই-উত্ত্রাইয়ের মধ্য দিয়ে ১৯-০১-১৯৯১ তারিখে নিম্ন\r\nমাধ্যমিক একাডেমিক স্বীকৃতি এবং ০১-০১-১৯৯৪ইং তাং নিম্ন মাধ্যমিক স্বীকৃতি ও\r\nএম.পি.ও ভূক্তি লাভ করে। নিম্ন মাধ্যমিক বিদ্যালয় হিসেবে দীর্ঘ সময় অতিবাহিত হওয়ার\r\nপর বিদ্যালয় পরিচালনা পরিষদের সম্মানিত সভাপতি অধ্যাপক এস,এম মুজিবুর রহমান সরকারী\r\nপ্রাথমিক বিদ্যালয়ের প্রধান শিক্ষক যুদ্বাহত মুক্তিযোদ্বা জনাব আঃ বাছেদ করিম ,অত্র\r\nবিদ্যালয়ের প্রধান শিক্ষক জহুরুল তালুকদার ও প্রতিষ্ঠাতা সদস্য জনাব <span style=\"mso-spacerun:yes\">&nbsp;</span>শ্রী গৌরাঈ কুমার মিত্র গং “নিম্ন মাধ্যমিক বিদ্যালয়\r\nটিকে “উচ্চ মাধ্যমিক বিদ্যালয়ে উন্নীত করার উদ্যোগ নেন এবং ০১-০১-১৯৯৯ইং সালে উচ্চ\r\nবিদ্যালয় স্তরের কার্যক্রম শুরু করে । সকলের ঐকান্তিক প্রচেষ্ঠায় ০১-০১-২০০২ইং\r\nসালে একাডেমিক স্বীকৃতি এবং ০১-০১-২০০৫ইং সালে উচ্চ বিদ্যালয় হসেবে প্রথম স্বীকৃতি\r\nলাভ করে। বিদযালয়টিতে জে,এস,সি ও এস,এস,সি পরীক্ষার ফলাফল সন্তোষজনক। <span style=\"mso-spacerun:yes\">&nbsp;</span></span><b style=\"mso-bidi-font-weight:normal\"><sup><span style=\"mso-bidi-font-size:14.0pt;line-height:115%;font-family:NikoshBAN;\r\nmso-bidi-language:BN-BD\"></span></sup></b></p>\r\n\r\n<!--[if gte mso 9]><xml>\r\n <w:LatentStyles DefLockedState=\"false\" DefUnhideWhenUsed=\"true\"\r\n  DefSemiHidden=\"true\" DefQFormat=\"false\" DefPriority=\"99\"\r\n  LatentStyleCount=\"267\">\r\n  <w:LsdException Locked=\"false\" Priority=\"0\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Nor