(61, 'প্রতিষ্ঠান প্রধানের বার্তা', 'messageofheadteacher', NULL, 21, 0, '“জীবনের প্রতি মুখে পড়িবে তোমার শূভ্র হাসি<br>প্রতি দুঃখে পড়িবে তোমার অশ্রু জল<br>প্রতি কাজে রবে তব শুভ হস্ত দুটি<br>কবি\r\n গুরু রবী ঠাকুরের আর্দশ খচিত পংক্তি মালার প্রতি শ্রদ্বাবনত হয়ে এই অজ \r\nপাড়াগায় ছোট বয়সেই একটি বিদ্যালয় যা এলাকাবাসীর যত্নে আদরের দুলালীর মত আজ \r\nপরিচিতি পাচ্ছে আর্দশ বিদ্যালয়। ঐতিহ্যবাহী ঘাটাইল উপজেলার ৩ংমডেল জামুরিয়া\r\n ইউনিয়নের ৫ং ওয়ার্ডের মমরেজ গলগন্ডা গ্রামের শিক্ষানুরাগী \r\nসমাজহিতৈষী,তরুণ,যুবক ও প্রধান ব্যক্তিবর্&nbsp;<span class=\"morecontent\"><span style=\"display: inline;\">্গের\r\n ঐকান্তিক প্রচেষ্টায় তালুক ভাদুরীর দশ-আনা তালুকের৫ মালিক স্বর্গীয় \r\nকৃতান্ত কুমার মিত্রের সহধর্মীনি দানবীর স্বর্গীয় হিরণ বালা মিত্রের ১.২১ \r\nএকর জমি এলাকার শিক্ষার বিকাশে ও বিদযালয় প্রতিষ্ঠার জন্য দান করেন। তাহার \r\nদানকৃত জমির উপর বিদ্যালয়টি প্রতিষ্ঠিত হয়। যা আজ উজ্জলতম নক্ষত্ররুপে \r\nসুদুর গগনে ঠাই করে নিয়েছে।<br><br>আমার প্রায় ২৪বৎসরের শিক্ষকতা পেশায় \r\nঅত্র বিদ্যালইয়ে আমি ১৭-০৪-২০১৪ইং তারিখে প্রধান শিক্ষক হিসেবে যোগদান করি।\r\n বিদ্যালয়ের সুদক্ষ পরিচালনা পরিষদ এবংদক্ষ কর্মঠ শিক্ষক মন্ডলীর সহযোগীতায়\r\n বিদ্যালয়ের শিক্ষার মান বৃদ্ধির জন্য নিরলস কাজ করে যাচ্ছি। বিদ্যালয়ে \r\nশিক্ষার মান বৃদ্ধির জন্য ধারাবাহিক মূল্যায়ন, সৃজনশীল পদ্ধতি,অনুসরনের \r\nচেষ্টা করিছি।<br><br>পরিশেষে বিদ্যালয় প্রতিষ্টার সাথে জড়িত সকল কে ধন্যবাদ জানাচ্ছি।<br>মোঃ আবু হানিফ খান<br>প্রধান শিক্ষক<br>মমরেজ গলগন্ডা পাবলিক উচ্চ বিদ্যালয়<br>ঘাটাইল,টাংগাইল</span></span>', '1450938847', 0, 1, 1);
